import React from "react";

function Product_list2({product}){
    return(
        <div className="flex">
            {
                product.map((productItem, productIndex) =>{
                    return(
                        <div>
                            {productItem.name};
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Product_list2;
